const yts = require("yt-search"); 

module.exports = {
    cmd: ["ytsearch", "yts"],
    tags: ["internet"], 
    example: "<query>",
    query: true,
    exec: async (m, sock, { }) => {
        let search = await yts(m.text);
        let text = "*YOUTUBE SEARCH*\n\n Result From " + m.text + `\n\n`;
        let no = 1;
        for (let i of search.all) {
            text += `No : ${no++}\nType : ${i.type}\nVideo ID : ${i.videoId}\nTitle : ${i.title}\nViews : ${i.views}\nDuration : ${i.timestamp}\nUpload At : ${i.ago}\nUrl : ${i.url}\n\n─────────────────\n\n`;
        }
        await sock.sendMessage(m.from, { image: { url: search.all[0].thumbnail }, caption: text }, { quoted: m });
    }
}

const youtube = require("yt-search");
const ytdl = require("ytdl-core");
const fs = require("fs"); 
const Func = require("../../lib/function"); 

module.exports = {
    cmd: ["play", "ytplay", "ytmp3"],
    tags: ["downloader"],
    example: "<query|link>",
    query: true,
    exec: async (m, sock, { }) => {
        try {
            var search = await youtube(m.text);
            var convert = search.videos[0];
            if (!convert) return m.reply("Video/Audio not found")
            if (convert.seconds >= 7200) {
                return m.reply("Video is longer than 2 hour!");
            } else {
                await ytdl.getInfo(convert.url);
                let mp3File = Func.getRandom(".mp3");
                var caption = `Title : ${convert.title}\nExt : Search\nID : ${convert.videoId}\nDuration : ${convert.timestamp}\nViewers : ${convert.views}\nUpload At : ${convert.ago}\nAuthor : ${convert.author.name}\nChannel : ${convert.author.url}\nUrl : ${convert.url}\nDescription : ${convert.description}\nThumbnail: ${convert.image}`;

                await sock.relayMessage(m.from, {
                    extendedTextMessage: {
                        text: caption,
                        contextInfo: {
                            externalAdReply: {
                                title: "Powered by " + process.env.BOT_NAME,
                                mediaType: 1,
                                previewType: 0,
                                renderLargerThumbnail: true,
                                thumbnailUrl: convert.image,
                                sourceUrl: convert.url
                            }
                        }
                    }
                }, {})
                ytdl(convert.url, {
                    filter: "audioonly"
                }).pipe(fs.createWriteStream(mp3File)).on("finish", async () => {
                    await sock.sendMessage(m.from, {
                        audio: fs.readFileSync(mp3File),
                        mimetype: "audio/mp4"
                    }, {
                        quoted: m
                    })
                    fs.unlinkSync(mp3File)
                });
            }
        } catch (e) {
            m.reply("PLAY: ", e);
        }
    }
}

